import React from "react";
import FulsoreLogo from "..//../assets/fulsorelogo.jpeg"; // Correct relative path

function Navbar() {
  console.log(FulsoreLogo); // Check if the image path is correct in the console

  return (
    <div>
      {/* upper Navbar */}
      <div>
        <div>
          <div>
            <a href="#">
              <img src={FulsoreLogo} alt="LOGO" /> {/* Correct usage */}
            </a>
          </div>
          {/* search bar */}
          <div>
            <div>
              <input
                type="text"
                placeholder="search"
                className="w-[200px] sm:w-[200px] group-hover:w-[300px] transition-all duration-300 rounded-full "
              ></input>
            </div>
          </div>
        </div>
      </div>
      {/* lower navbar */}
      <div></div>
    </div>
  );
}

export default Navbar;
